text:
 @SemNome-po1qs  como pode ser tão otário. De 1960 até 1999 foram vários clube que ganharam esse mundial, não foi só o Grêmio, teve Real Madrid, Barcelona, Bayer de Munique, São Paulo, Flamengo, Olímpia, Boca Junior, Nacional do Uruguai e tantos outros clubes. Vai lá na torcida dos caras é fala que o mundial deles não vale nada, tem coragem de ir mané?
Para o seu conhecimento, já que você tem preguiça de pesquisar,
a FIFA reconheceu todos os títulos antes de 2000. Tu parece uma Maria vai com as outras.
